import './output.css';
import './App.css';
import { Link, useParams } from "react-router-dom";

export default function Sidebar({ user }) {
  const { username } = useParams();

  const baseUrl = `/${username}`;

  return (
    <div className="bg-pink-100 h-screen w-48 flex flex-col p-4 space-y-4 shadow-lg">
      {/* User Info */}
      {user && (
        <div className="text-center pb-4 border-b border-pink-300">
          <div className="mb-2">
            {user.profilePicture ? (
              <img
                src={user.profilePicture}
                alt={user.username}
                className="h-12 w-12 rounded-full mx-auto border-2 border-pink-300"
              />
            ) : (
              <div className="h-12 w-12 rounded-full bg-gradient-to-r from-pink-300 to-green-300 flex items-center justify-center text-pink-700 font-bold text-lg mx-auto border-2 border-pink-300">
                {user.username.charAt(0).toUpperCase()}
              </div>
            )}
          </div>
          <p className="text-pink-700 font-bold text-sm">
            {user.username}
          </p>
          <p className="text-pink-500 text-xs">
            Level {user.level} ‚Ä¢ {user.points} points
          </p>
          <p className="text-pink-500 text-xs">
            {user.streak} day streak üî•
          </p>
        </div>
      )}

      {/* Navigation Links */}
      <Link
        to={baseUrl}
        className="text-pink-700 text-xl font-bold font-hand hover:text-pink-900 transition-colors duration-200 flex items-center"
      >
        <span className="mr-2">üè†</span>
        Dashboard
      </Link>
      <hr className="border-pink-300" />

      <Link
        to={`${baseUrl}/journals`}
        className="text-pink-700 text-lg font-bold font-hand hover:text-pink-900 transition-colors duration-200 flex items-center"
      >
        <span className="mr-2">üìù</span>
        My Journals
      </Link>
      <hr className="border-pink-300" />

      <Link
        to={`${baseUrl}/entry`}
        className="text-pink-700 text-lg font-bold font-hand hover:text-pink-900 transition-colors duration-200 flex items-center"
      >
        <span className="mr-2">‚úçÔ∏è</span>
        New Entry
      </Link>
      <hr className="border-pink-300" />

      <Link
        to={`${baseUrl}/affirmations`}
        className="text-pink-700 text-lg font-bold font-hand hover:text-pink-900 transition-colors duration-200 flex items-center"
      >
        <span className="mr-2">üíù</span>
        Affirmations
      </Link>
      <hr className="border-pink-300" />

      <Link
        to={`${baseUrl}/community`}
        className="text-pink-700 text-lg font-bold font-hand hover:text-pink-900 transition-colors duration-200 flex items-center"
      >
        <span className="mr-2">üë•</span>
        Community
      </Link>
      <hr className="border-pink-300" />

      <Link
        to={`${baseUrl}/insights`}
        className="text-pink-700 text-lg font-bold font-hand hover:text-pink-900 transition-colors duration-200 flex items-center"
      >
        <span className="mr-2">üìä</span>
        Insights
      </Link>
      <hr className="border-pink-300" />

      {/* Quick Stats */}
      {user && (
        <div className="mt-auto pt-4 border-t border-pink-300">
          <div className="text-center text-xs text-pink-600 space-y-1">
            <p>üìö {user.totalEntries} entries</p>
            <p>üåü {user.points} points earned</p>
            <p>üî• {user.streak} day streak</p>
          </div>
        </div>
      )}
    </div>
  );
}
